import React, { useState, useEffect } from 'react';
import { useAuth } from '../../hooks/useAuth';
import axios from 'axios';
import './DebugPanel.css';

const DebugPanel = ({ isVisible, onToggle }) => {
    const { user } = useAuth();
    const [debugData, setDebugData] = useState(null);
    const [realTimeData, setRealTimeData] = useState({
        profileCompleteness: 0,
        lastUpdate: new Date(),
        recentChanges: []
    });
    const [isExpanded, setIsExpanded] = useState(false);

    useEffect(() => {
        if (isVisible) {
            fetchDebugData();
            const interval = setInterval(fetchDebugData, 5000); // Update every 5 seconds
            return () => clearInterval(interval);
        }
    }, [isVisible]);

    const fetchDebugData = async () => {
        try {
            const token = localStorage.getItem('token');
            const response = await axios.get('http://localhost:5000/api/matching/analytics', {
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            });
            
            setDebugData(response.data);
            updateRealTimeData(response.data);
        } catch (err) {
            console.error('Debug panel fetch error:', err);
        }
    };

    const updateRealTimeData = (data) => {
        setRealTimeData(prev => {
            const newChange = {
                timestamp: new Date(),
                type: 'profile_update',
                change: `Completeness: ${data.profileCompleteness}%`,
                impact: data.averageMatchScore
            };

            return {
                profileCompleteness: data.profileCompleteness,
                lastUpdate: new Date(),
                recentChanges: [newChange, ...prev.recentChanges].slice(0, 5)
            };
        });
    };

    const calculateQuestionnaireImpact = () => {
        if (!user || !debugData) return { score: 0, factors: [] };

        const factors = [];
        let totalScore = 0;

        // Communication preferences impact
        if (user.socialPreferences?.communicationStyle) {
            factors.push({ name: 'Communication Style', impact: '+15%', status: 'active' });
            totalScore += 15;
        } else {
            factors.push({ name: 'Communication Style', impact: 'Missing', status: 'missing' });
        }

        // Social energy impact
        if (user.socialPreferences?.socialEnergy) {
            factors.push({ name: 'Social Energy', impact: '+12%', status: 'active' });
            totalScore += 12;
        } else {
            factors.push({ name: 'Social Energy', impact: 'Missing', status: 'missing' });
        }

        // Activity level impact
        if (user.lifestyle?.activityLevel) {
            factors.push({ name: 'Activity Level', impact: '+10%', status: 'active' });
            totalScore += 10;
        } else {
            factors.push({ name: 'Activity Level', impact: 'Missing', status: 'missing' });
        }

        // Values impact
        if (user.values?.friendshipValues) {
            factors.push({ name: 'Friendship Values', impact: '+18%', status: 'active' });
            totalScore += 18;
        } else {
            factors.push({ name: 'Friendship Values', impact: 'Missing', status: 'missing' });
        }

        return { score: totalScore, factors };
    };

    const impactData = calculateQuestionnaireImpact();

    if (!isVisible) {
        return (
            <div className="debug-toggle" onClick={onToggle}>
                <span className="debug-icon">🐛</span>
                <span className="debug-text">Dev Panel</span>
            </div>
        );
    }

    return (
        <div className={`debug-panel ${isExpanded ? 'expanded' : 'collapsed'}`}>
            <div className="debug-header" onClick={() => setIsExpanded(!isExpanded)}>
                <div className="debug-title">
                    <span className="debug-icon">🔬</span>
                    <span>Development Debug Panel</span>
                    <span className="debug-status">
                        {debugData ? '✅ Connected' : '❌ Disconnected'}
                    </span>
                </div>
                <div className="debug-controls">
                    <button 
                        className="debug-btn refresh" 
                        onClick={(e) => { e.stopPropagation(); fetchDebugData(); }}
                    >
                        🔄
                    </button>
                    <button 
                        className="debug-btn close" 
                        onClick={(e) => { e.stopPropagation(); onToggle(); }}
                    >
                        ✖️
                    </button>
                </div>
            </div>

            {isExpanded && (
                <div className="debug-content">
                    {/* Real-time Stats */}
                    <div className="debug-section">
                        <h4>⚡ Real-time Profile Impact</h4>
                        <div className="debug-stats">
                            <div className="debug-stat">
                                <span className="stat-label">Profile Completeness:</span>
                                <span className="stat-value">{realTimeData.profileCompleteness}%</span>
                            </div>
                            <div className="debug-stat">
                                <span className="stat-label">Questionnaire Impact:</span>
                                <span className="stat-value">+{impactData.score}% match quality</span>
                            </div>
                            <div className="debug-stat">
                                <span className="stat-label">Last Update:</span>
                                <span className="stat-value">{realTimeData.lastUpdate.toLocaleTimeString()}</span>
                            </div>
                        </div>
                    </div>

                    {/* Questionnaire Factor Breakdown */}
                    <div className="debug-section">
                        <h4>🎯 Questionnaire Factors</h4>
                        <div className="factor-list">
                            {impactData.factors.map((factor, index) => (
                                <div key={index} className={`factor-item ${factor.status}`}>
                                    <span className="factor-name">{factor.name}</span>
                                    <span className="factor-impact">{factor.impact}</span>
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Recent Changes */}
                    <div className="debug-section">
                        <h4>📊 Recent Profile Changes</h4>
                        <div className="changes-list">
                            {realTimeData.recentChanges.length > 0 ? (
                                realTimeData.recentChanges.map((change, index) => (
                                    <div key={index} className="change-item">
                                        <span className="change-time">
                                            {change.timestamp.toLocaleTimeString()}
                                        </span>
                                        <span className="change-text">{change.change}</span>
                                        <span className="change-impact">Impact: {change.impact}%</span>
                                    </div>
                                ))
                            ) : (
                                <div className="no-changes">No recent changes detected</div>
                            )}
                        </div>
                    </div>

                    {/* User Data Debug */}
                    <div className="debug-section">
                        <h4>🔍 User Data Structure</h4>
                        <div className="data-preview">
                            <details>
                                <summary>Social Preferences</summary>
                                <pre>{JSON.stringify(user?.socialPreferences || {}, null, 2)}</pre>
                            </details>
                            <details>
                                <summary>Lifestyle Data</summary>
                                <pre>{JSON.stringify(user?.lifestyle || {}, null, 2)}</pre>
                            </details>
                            <details>
                                <summary>Values</summary>
                                <pre>{JSON.stringify(user?.values || {}, null, 2)}</pre>
                            </details>
                        </div>
                    </div>

                    {/* Match Analytics */}
                    {debugData && (
                        <div className="debug-section">
                            <h4>🎲 Live Match Analytics</h4>
                            <div className="analytics-preview">
                                <div className="analytics-item">
                                    <span>High Quality Matches:</span>
                                    <span>{debugData.highQualityMatches}/{debugData.totalPotentialMatches}</span>
                                </div>
                                <div className="analytics-item">
                                    <span>Average Match Score:</span>
                                    <span>{debugData.averageMatchScore}%</span>
                                </div>
                                <div className="analytics-item">
                                    <span>Potential Improvement:</span>
                                    <span>+{debugData.potentialImprovement}%</span>
                                </div>
                            </div>
                        </div>
                    )}
                </div>
            )}
        </div>
    );
};

export default DebugPanel;
